class breadbox {
    constructor (runtime, extensionId) {
		this.icon = 'data:image/svg+xml;base64,';
    	this.menuicon = 'data:image/svg+xml;base64,';
		this.runtime = runtime;
    }

    getInfo () {
        return {
            "id": 'breadbox',
            "name": 'breadbox',
			"blockIconURI": this.icon,
			"menuIconURI": this.menuicon,
            "blocks": [
                {
                    "opcode": "fetchFromURL",
                    "blockType": "reporter",
                    "text": "fetch data from [URL]",
                    "arguments": {
                        "URL": {
                            "type": "string",
                            "defaultValue": "https://api.github.com/status"
                        },
                    },
                },
				{
                    "opcode": "startsWith",
                    "blockType": "Boolean",
                    "text": "[VAL1] starts with [VAL2]?",
                    "arguments": {
                        "VAL1": {
                            "type": "string",
                            "defaultValue": "foobar",
                        },
                        "VAL2": {
                            "type": "string",
                            "defaultValue": "foo",
                        },
                    },
                },
                {
                    "opcode": "endsWith",
                    "blockType": "Boolean",
                    "text": "[VAL1] ends with [VAL2]?",
                    "arguments": {
                        "VAL1": {
                            "type": "string",
                            "defaultValue": "foobar",
                        },
                        "VAL2": {
                            "type": "string",
                            "defaultValue": "bar",
                        },
                    },
                }
			]
        };
    };

    fetchFromURL({URL}) {
        return fetch(URL).then(response => response.text());
    };

    startsWith({VAL1, VAL2}) {
        if (VAL1.startsWith(VAL2)) {
            return true;
        } else {
            return false;
        }
    };

    endsWith({VAL1, VAL2}) {
        if (VAL1.endsWith(VAL2)) {
            return true;
        } else {
            return false;
        }
    };
};

(function() {
    var extensionClass = breadbox;
    if (typeof window === "undefined" || !window.vm) {
        Scratch.extensions.register(new extensionClass());
		console.log("Sandboxed mode detected, performance will suffer because of the extension being sandboxed.");
    } else {
        var extensionInstance = new extensionClass(window.vm.extensionManager.runtime);
        var serviceName = window.vm.extensionManager._registerInternalExtension(extensionInstance);
        window.vm.extensionManager._loadedExtensions.set(extensionInstance.getInfo().id, serviceName);
		console.log("Unsandboxed mode detected. Good.");
    };
})()
